const mongoose = require('mongoose');

const { Schema } = mongoose;

const gameSchema = new Schema({
  name: String
});

// const Game = mongoose.model('Game', gameSchema);
const Game = global.gameSchema || mongoose.model('Game', gameSchema);

module.exports = {
  Game
};
